def hamming_distance(s, t):
    # Check if the strings are of equal length
    if len(s) != len(t):
        raise ValueError("Strings must be of equal length.")
    
    # Count mismatches between corresponding symbols in the two strings
    return sum(1 for a, b in zip(s, t) if a != b)

# Sample Dataset
s = ""
t = ""

# Calculate and print the Hamming distance
distance = hamming_distance(s, t)
print(distance)
